(function (Drupal) {

  var documentReadyComplete = false;

  Drupal.behaviors.shareButtonsBehavior = {
    attach: function (context, settings) {

      //check to see whether the page has been fully loaded (readyState == complete) or not
      if (!documentReadyComplete) {
        var checkDocumentReadyInterval = setInterval(function() {
          if (document.readyState === "complete") {
            clearInterval(checkDocumentReadyInterval);
            _documentIsReady();
          }
        }, 100);
        documentReadyComplete = true;
      }

      //runs once, when the JS file is loaded
      function _documentIsReady() {
        //find all existing share buttons and set up their functionality
        var shareButtons = document.getElementsByClassName("share-btn");
        for (var x = 0; x < shareButtons.length; x++) {
          shareButtons[x].addEventListener("click", function() {Drupal.behaviors.shareButtonsBehavior.clickedShareButton(this)});
        }
      }

    },

    //this is setup as a function that can be called from other features, since their share buttons may not be loaded right away
    clickedShareButton: function(buttonClicked) {
      if (buttonClicked != undefined) {
        //the default location to be shared is the current location
        var shareLocation = "" + window.location;
        //but use the data-link-to property, if provided
        if (buttonClicked.dataset.linkTo != undefined && buttonClicked.dataset.linkTo != "") {
          shareLocation = buttonClicked.dataset.linkTo;
        }
        //figure out what social media this is referring to and open its corresponding window
        var windowOpenLocation = "";
        if (buttonClicked.classList.contains("fa-facebook") > 0) {
          windowOpenLocation = "https://www.facebook.com/sharer.php?u=" + shareLocation;
        } else if (buttonClicked.classList.contains("fa-twitter") > 0) {
          windowOpenLocation = "https://twitter.com/share?url=" + shareLocation;
        } else if (buttonClicked.classList.contains("fa-linkedin") > 0) {
          windowOpenLocation = "https://www.linkedin.com/sharing/share-offsite/?url=" + shareLocation;
        } else if (buttonClicked.classList.contains("fa-reddit-alien") > 0) {
          windowOpenLocation = "https://reddit.com/submit?url=" + shareLocation;
        } else {
          //this social media button was not configured properly
        }
        if (windowOpenLocation != "") {
          window.open(windowOpenLocation, "", "width=600,height=600");
        }
      }
    }

  };
})(Drupal);
