(function ($, Drupal) {

    //TODO - remove jquery

    var initialized = false;

    Drupal.behaviors.numberCountUpBehavior = {
        attach: function (context, settings) {

            if (!initialized) {
                var checkDocumentReadyInterval = setInterval(function() {
                    if (document.readyState === "complete") {
                        clearInterval(checkDocumentReadyInterval);
                        setup();
                    }
                }, 100);
                initialized = true;
            }
            
            function setup() {
                $(".number-count-up[data-finished!='true']").each(function() {
                    if ($(this).isOnScreen() && ($(this).attr('data-running') != "true") && ($(this).attr('data-finished') != "true")) {
                        $(this).countUp();
                    }
                });
            }
            
            //determine if an element is on screen
            $.fn.isOnScreen = function(){
                var win = $(window);
                var viewport = {
                    top : win.scrollTop(),
                    left : win.scrollLeft()
                };
                viewport.right = viewport.left + win.width();
                viewport.bottom = viewport.top + win.height();
                var bounds = this.offset();
                bounds.right = bounds.left + this.outerWidth();
                bounds.bottom = bounds.top + this.outerHeight();
                return (!(viewport.right < bounds.left || viewport.left > bounds.right || viewport.bottom < bounds.top || viewport.top > bounds.bottom));
            };
            
            //run a .number-count-up element
            $.fn.countUp = function() {
                var $this = $(this);
                var countTo = $this.attr('data-count');
                $this.attr("data-running", true);
                $({
                    countNum: $this.text()
                }).animate({
                    countNum: countTo
                }, {
                    duration: 2000,
                    easing: 'swing',
                    step: function() {
                        $this.text(Math.floor(this.countNum));
                    },
                    complete: function() {
                        $this.text(this.countNum);
                        $this.attr("data-finished", true);
                    }
                });
            }

            //on page scroll, check to see if a number-count-up element is on screen
            $(window).scroll(function() {
                $(".number-count-up[data-finished!='true']").each(function() {
                    if ($(this).isOnScreen() && ($(this).attr('data-running') != "true") && ($(this).attr('data-finished') != "true")) {
                        $(this).countUp();
                    }
                });
            });
            
        }
    }

})(jQuery, Drupal);;
(function ($, Drupal) {

    //TODO - remove jquery
    //TODO - can this be fixed to add marketo buttons as they are added (and adjust previous buttons), instead of using an interval to check?
    //TODO - add support for buttons in colorbox components

    var initialized = false;

    Drupal.behaviors.gtmBehavior = {
        attach: function (context, settings) {
            $(document).ready(function() {
                if (!initialized) {
                    initialized = true;
                    var checkMarketoInterval = setInterval(function() {
                        //check to see if Marketo has loaded
                        var marketoElements = $(".main-container article > .content > .field > .field--item > .paragraph:not(.paragraph--type--colorbox-content) .mktoButton").length;
                        //once the Marketo elements have had a chance to load, add as many button classes as we can find
                        //note that if Marketo stuff hasn't loaded within this time, these buttons will not be included in the totals currently
                        //if (marketoElements > 0) {
                            clearInterval(checkMarketoInterval);
                            _addButtonClassesForGTM();
                        //}
                    }, 1500);
                }
            });
        }
    };

    //function - Adds information to buttons for GTM to use.
    function _addButtonClassesForGTM() {
        var containerComponentTypes = [
            "tabs-container",
            "slideshow-container",
            "cards-container",
        ];
        var visibleComponentButtonsQuery =
            ".main-container article > .content > .field > .field--item > .paragraph:not(.paragraph--type--colorbox-content) .button, " +
            ".main-container article > .content > .field > .field--item > .paragraph:not(.paragraph--type--colorbox-content) .mktoButton "
        ;
        var visibleComponentsQuery = ".main-container article > .content > .field > .field--item > .paragraph:not(.paragraph--type--colorbox-content)";
        //for each button within a visible component, assign classes to that button
        $(visibleComponentButtonsQuery).each(function( index, buttonElement ) {
            var componentType = _getNeedleFromHaystack("paragraph--type--", $(_getComponentParent(buttonElement)).attr("class").split(/\s+/), "--");
            var componentSection = _getNeedleFromHaystack("field--name-field-paragraphs-", $($(buttonElement).closest(".main-container article > .content > .field")).attr("class").split(/\s+/));
            //what type of content this page is
            $(buttonElement).addClass("page-type-" + _getNeedleFromHaystack("page-node-type-", $("body").attr("class").split(/\s+/), "page-node-type-"));
            //how many buttons total were found
            $(buttonElement).addClass("button-page-total-" + $(visibleComponentButtonsQuery).length);
            //which button out of the total this button was
            $(buttonElement).addClass("button-page-number-" + (index+1));
            //the text of the button
            //this does not sanitize the text, not good for a class
            //$(buttonElement).addClass("button-text-" + $(buttonElement).text());
            //which section this component was in
            $(buttonElement).addClass("component-section-" + componentSection);
            //how many components total were found
            $(buttonElement).addClass("component-total-" + $(visibleComponentsQuery).length);
            //which # component this button was within
            $(buttonElement).addClass("component-number-" +  _getComponentNumber(buttonElement, componentSection));
            //which type of component this button was in
            $(buttonElement).addClass("component-type-" + componentType);
            //container components (cards, slideshows, tabs) get even more info
            if (containerComponentTypes.indexOf(componentType) >= 0) {
                //the total number of items in this container
                $(buttonElement).addClass("container-item-total-" + $(buttonElement).closest(".component-container").children(".component-container-item").length);
                //which item the button was within
                $(buttonElement).addClass("container-item-number-" + _getNeedleFromHaystack("component-container-item-", $(buttonElement).closest(".component-container-item").attr("class").split(/\s+/)));
            }
            //for card containers, whether it was the card's front or back
            if (componentType == "cards-container") {
                $(buttonElement).addClass("card-container-side-" + ($(buttonElement).closest(".card-content").parent().hasClass("flip-card-front") ? "front" : "back"));
            }
        });
        //assign classes to the gated-downloads modal
        $("#block-gatedcontentmodal .mktoButton").addClass("button-blue page-type-download component-type-block-content modal-gated-content");
    }

    //function - Gets the position a component is within a specific section (header, content, or footer).
    //return - The number component this component is within a specific section (header, content, or footer).
    function _getComponentNumberInSection(buttonElement, sectionComponents) {
        var componentCount = 0;
        $(sectionComponents).each(function( index, currentItem) {
            componentCount++;
            if ($(currentItem).is(_getComponentParent(buttonElement))) { return false; }
        });
        return componentCount;
    }

    //function - Gets the number component of the component, that the button is in. 
    //return - The number component of the component that the button is in.
    function _getComponentNumber(buttonElement, componentSection) {
        //Count up all of the components in the previous sections (header, content, or footer),
        //then add the number component within its own section
        var sectionComponentNumber = 0;
        var headerComponents = $(".main-container article > .content > .field--name-field-paragraphs-header > .field--item > .paragraph:not(.paragraph--type--colorbox-content)");
        var contentComponents = $(".main-container article > .content > .field--name-field-paragraphs-content > .field--item > .paragraph:not(.paragraph--type--colorbox-content)");
        var footerComponents = $(".main-container article > .content > .field--name-field-paragraphs-footer > .field--item > .paragraph:not(.paragraph--type--colorbox-content)");
        if (componentSection == "header") {
            sectionComponentNumber = _getComponentNumberInSection(buttonElement, headerComponents);
        } else if (componentSection == "content") {
            sectionComponentNumber = headerComponents.length + _getComponentNumberInSection(buttonElement, contentComponents);
        } else {
            sectionComponentNumber = headerComponents.length + contentComponents.length + _getComponentNumberInSection(buttonElement, footerComponents);
        }
        return sectionComponentNumber;
    }

    //function - Gets the component parent from a button element.
    //return - The component parent that the button is within.
    function _getComponentParent(buttonElement) {
        return $(buttonElement).closest(".main-container article > .content > .field > .field--item > .paragraph");
    }

    //function - Finds a string within an array. This is specific to this JS since it does not return the whole needle object found.
    //return - The end of the needle string, based on the lastIndexOfString token.
    function _getNeedleFromHaystack(needle, haystack, lastIndexOfString = "-") {
        var returnNumber = "";
        $(haystack).each(function( index, currentItem) {
            if(currentItem.startsWith(needle)) {
                returnNumber = currentItem.substring(currentItem.lastIndexOf(lastIndexOfString) + (lastIndexOfString.length));
                return false;
            }
        });
        return returnNumber;
    }

})(jQuery, Drupal);;
