  Drupal.behaviors.componentSlideshowCarouselContainerBehavior = {
    attach: function (context, settings) {

      //check to see whether the page has been fully loaded (readyState == complete) or not
      if (!documentReadyComplete) {
        var checkDocumentReadyInterval = setInterval(function() {
          if (document.readyState === "complete") {
            clearInterval(checkDocumentReadyInterval);
            _documentIsReady();
          }
        }, 100);
        documentReadyComplete = true;
      }

      //runs once, when the JS file is loaded
      function _documentIsReady() {
        //run through all the slideshow carousel containers
        $(".paragraph--type--slideshow-carousel-container").each(function( index ) {
          var $carousel = $(this);
          //immediately pause the carousel
          $carousel.carousel({interval: 0});
          //set the left/right arrow functions
          $(".left").click(function(){
            if ($(this).hasClass("enabled")) {
              //setCarouselControlStatus("disabled");
              $carousel.carousel("prev");
              //go through all the items and move their animation class up
              var items = $carousel.find(".item.animate-to").each(function( index ) {
                $(this).removeClass(function (index, className) {
                  $(this).removeClass("animate-to");
                  var currentAnimateClass = className.match(/(^|\s)position-(\S)+/);
                  var newClassPosition = parseInt(currentAnimateClass[2]) + 1;
                  if (newClassPosition <= 6) {
                    $(this).addClass("animate-to position-" + newClassPosition);
                  }
                  return (className.match (/(^|\s)position-\S+/g) || []).join(' ');
                });
              });
              //re-set the active class
              $carousel.find(".item.active").removeClass("active");
              $carousel.find(".item.position-3").addClass("active");
              //find which item needs the position-0 class
              var enteringCarouselItem = $carousel.find(".item.position-1").prev();
              if (enteringCarouselItem.length == 0) {
                enteringCarouselItem = $carousel.find(".item").last();
              }
              $(enteringCarouselItem).addClass("animate-to position-0");
              //after the rotation animation, fade in the content
              fadeInContentBox($carousel);
            }
          });
          $(".right").click(function() {
            if ($(this).hasClass("enabled")) {
              //setCarouselControlStatus("disabled");
              $carousel.carousel("next");
              //go through all the items and move their animation class down
              var items = $carousel.find(".item.animate-to").each(function( index ) {
                $(this).removeClass(function (index, className) {
                  $(this).removeClass("animate-to");
                  var currentAnimateClass = className.match(/(^|\s)position-(\S)+/);
                  var newClassPosition = parseInt(currentAnimateClass[2]) - 1;
                  if (newClassPosition >= 0) {
                    $(this).addClass("animate-to position-" + newClassPosition);
                  }
                  return (className.match (/(^|\s)position-\S+/g) || []).join(' ');
                });
              });
              //re-set the active class
              $carousel.find(".item.active").removeClass("active");
              $carousel.find(".item.position-3").addClass("active");
              //find which item needs the position-0 class
              var enteringCarouselItem = $carousel.find(".item.position-5").next();
              if (enteringCarouselItem.length == 0) {
                enteringCarouselItem = $carousel.find(".item").first();
              }
              $(enteringCarouselItem).addClass("animate-to position-6");
              //after the rotation animation, fade in the content
              fadeInContentBox($carousel);
            }
          });
        });
      }

      function addAnimationClasses(carousel, direction) {
        $(carousel).find(".field--name-field-sub-components .component-container-item").each(function( index ) {
          if (index <= 5) {
            $(this).addClass("slideshow-carousel-animation animate-to-" + direction + "-" + index);
          }
        });
      }

      function fadeInContentBox(carousel) {
        var $carousel = $(carousel);
        $carousel.find(".item.position-3").on("transitionend", function() {
          $(this).off("transitionend");
          //hide previously active content
          $previousActiveItem = $carousel.find(".carousel-item-content.active")
          $previousActiveItem.removeClass("active");
          // $previousActiveItem.parent().removeClass("active");
          //fade in the now-active content
          var newActiveContent = $(this).find(".carousel-item-content .paragraph--type--carousel-slideshow-item");
          $(newActiveContent).parent().addClass("active");
          // $(newActiveContent).addClass("active");
          //when the content is done fading in, re-enable the controls
          $(newActiveContent).on("transitionend", function() {
            $(this).off("transitionend");
            setCarouselControlStatus("enabled");
          });
        });
      }

      function setCarouselControlStatus(status) {
        $(".paragraph--type--slideshow-carousel-container .left, .paragraph--type--slideshow-carousel-container .right").removeClass("enabled disabled").addClass(status);
      }

    }
  };
